                                    <input 
                                    type="number" 
                                    id="latitude"
                                    name="latitude"
                                    placeholder="Latitude"
                                    class="form-input"
                                    value={latitude}
                                    onChange={(e) => setLatitude(e.target.value)} disabled>
                                    </input>
                                </td>
                                <td>Longitude</td>
                                <td>
                                    <input 
                                    type="number" 
                                    id="longitude"
                                    name="longitude"
                                    placeholder="Longitude"
                                    class="form-input"
                                    value={longitude}
                                    onChange={(e) => setLongitude(e.target.value)}  disabled> 
                                    </input>
                                </td>
                                <td></td>
                                <td>    
                                </td>
                                <td></td>
                            </tr>

