                                </td>
                                <td>Distance</td>
                                <td>
                                    <input 
                                    type="number" 
                                    id="distance"
                                    name="distance"
                                    placeholder="Distance"
                                    class="form-input"
                                    value={distance}
                                    onChange={(e) => setDistance(e.target.value)} disabled={(statusRadio === 1? true : false)}> 
                                    </input> NM
                                </td>
                                <td></td>
                                <td></td>
                                <td></td>
