                                    type="number" 
                                    id="ais-name"
                                    name="ais-name"
                                    placeholder="ais-name"
                                    class="form-input"
                                    value={mode2code}
                                    onChange={(e) => setMode2Code(e.target.value)} disabled>
                                    </input>
                                </td>
                                <td>ETA</td>
                                <td>
                                    <input 
                                    type="datetime-local" 
                                    id="eta" 
                                    name="eta"
                                    class="form-input"
                                    value={endTime}
                                    onChange={(e) => setEndTime(e.target.value)}
