                                    onChange={(e) => setMode2Code(e.target.value)} disabled>
                                    </input>
                                </td>
                                <td>Destination</td>
                                <td>
                                    <input 
                                    type="number" 
                                    id="destination"
                                    name="destination"
                                    placeholder="Destination"
                                    class="form-input"
                                    value={mode2code}
                                    onChange={(e) => setMode2Code(e.target.value)} disabled>
                                    </input>
                                </td>
                            </tr>

