                                <td></td>
                                <td>AIS Type</td>
                                <td>             
                                    <select name="ais-type"  class="form-input" id="ais-type" onChange={handleTrackInput} disabled>
                                        <option value="-">-- Pilih --</option>
                                        <option value="single">Single</option>
                                        <option value="multi">Multi</option>
                                        <option value="import">Import</option>
                                    </select>
                                </td>
                                <td>Nav Status</td>
                                <td>             
                                    <select name="nav-status" class="form-input" id="nav-status" onChange={(e) => setMode4Code(e.target.value)} disabled>
                                        <option value="-">-- Pilih --</option>
                                        <option value="0">Not Interogated</option>
                                        <option value="1">Valid Response</option>
                                        <option value="2">No Respose</option>
                                        <option value="3">Invalid</option>
                                    </select>
                                </td>
                                <td>Dimensions C</td>
                                <td>
                                    <input 
                                    type="number" 
                                    id="dimensions-c"
