                                    class="form-input"
                                    value={mode2code}
                                    onChange={(e) => setMode2Code(e.target.value)} disabled>
                                    </input>
                                </td>
                                <td>Dimensions D</td>
                                <td>
                                    <input 
                                    type="number" 
                                    id="dimensions-d"
